(function() {
    'use strict';

    // Base64 encoded string of the PNG image
    const newIconBase64 = 'data:image/png;base64,'; // Truncated for brevity

    // Function to replace the SVG icon with a PNG image
    function replaceIcon() {
        // Find the anchor tag with aria-label="X"
        const homeButton = document.querySelector('a[aria-label="X"]');
        if (homeButton) {
            // Find the SVG inside the anchor tag
            const svgIcon = homeButton.querySelector('svg');
            if (svgIcon) {
                // Create a new img element
                const imgIcon = document.createElement('img');
                imgIcon.src = newIconBase64;
                imgIcon.alt = 'Home';
                imgIcon.style.width = '70px';  // Adjust size as necessary
                imgIcon.style.height = '50px'; // Adjust size as necessary

                // Replace the SVG with the new img element
                svgIcon.replaceWith(imgIcon);
            }
        }
    }

    // Call the function to replace the icon
    replaceIcon();

    // Observe for changes to reapply the change if the icon gets replaced
    const observer = new MutationObserver(replaceIcon);
    observer.observe(document.body, { childList: true, subtree: true });
})();
